import React from 'react';
import './App.css';
import { BrowserRouter, Route } from 'react-router-dom';
import Signin from './components/profile/profile';
import Profile from './components/register/signin';


function App() {
  return (
    <div className="wrapper">
      <BrowserRouter>
        <switch>
          <Route path="/profile">
            <Profile />
          </Route>
          <Route path="/">
            <Profile />
          </Route>
        </switch>
      </BrowserRouter>
    </div>
  );
}


export default App;
